		static void testCopyMethods( IDataItem spectrums) throws Exception {
			// Getting a region in the spectrum stack to test copy
    		int[] origin = new int[spectrums.getRank()];
    		int[] shape  = new int[spectrums.getRank()];
    		java.util.Arrays.fill(origin, 2);
    		java.util.Arrays.fill(shape , 1);
    		origin[origin.length - 1] = 0;
    		shape[shape.length - 2] = spectrums.getShape()[shape.length - 2] > 5 ? 5 : spectrums.getShape()[shape.length - 2];
    		shape[shape.length - 1] = spectrums.getShape()[shape.length - 1];
    		shape[0] = spectrums.getShape()[0] > 2 ? 2 : spectrums.getShape()[0] - 1;
    		int i = 0;
    		for( int size : spectrums.getShape() ) {
    			if( origin[i] + shape[i] >= size && size > 0 ) {
    				origin[i] = size - shape[i];
    			}
				i++;
    		}
			IArray array = spectrums.getData(origin, shape);
			IArray copyStructure;
			IArray copyData1;
			IArray copyData2;
			
			System.out.print("--> IArray.copy(false) <=> no storage copy: ");
			copyStructure = array.copy(false);
			Tools.compareArrays( array, copyStructure );
			
			System.out.print("--> IArray.copy(true) <=> storage copy: ");
			copyData1 = array.copy(true);
			Tools.compareArrays( array, copyData1 );
			
			System.out.print("--> IArray.copy() <=> storage copy: ");
			copyData2 = array.copy();
			Tools.compareArrays( array, copyData2 );
		}
		
