		static private void testRegionArray(IDataItem spectrums) throws Exception {
			// Getting a region in the spectrum stack
			int[] origin = new int[spectrums.getRank()];
    		int[] shape  = new int[spectrums.getRank()];
    		java.util.Arrays.fill(origin, 2);
    		java.util.Arrays.fill(shape , 1);
    		origin[origin.length - 1] = 0;
    		shape[shape.length - 2] = spectrums.getShape()[shape.length - 2] > 5 ? 5 : spectrums.getShape()[shape.length - 2];
    		shape[shape.length - 1] = spectrums.getShape()[shape.length - 1];
    		shape[0] = spectrums.getShape()[0] > 2 ? 2 : spectrums.getShape()[0] - 1;
    		int i = 0;
    		for( int size : spectrums.getShape() ) {
    			if( origin[i] + shape[i] >= size && size > 0 ) {
    				origin[i] = size - shape[i];
    			}
				i++;
    		}

    		IArray array1 = spectrums.getData();
    		IArrayIterator region1 = array1.getRegionIterator(origin, shape);
    		IArray array2 = spectrums.getData(origin, shape);
    		IArrayIterator region2 = array2.getIterator();
    		System.out.println("----------");
    		System.out.println("Comparing IArray.getRegionIterator(int[] origin, int[] shape) && DataItem.getData(int[] origin, int[] shape).getIterator()");
    		System.out.print("Region shape: ");
    		Tools.scanArray(shape, "display");
    		System.out.print("--> " + Tools.memory.toString() );
    		System.out.print("Region origin: ");
    		Tools.scanArray(origin, "display");
    		System.out.print("--> " + Tools.memory.toString() );
    		Object obj1, obj2;
    		while( region1.hasNext() || region2.hasNext() ) {
    			if( ! region1.hasNext() || ! region2.hasNext() ) {
    				throw new Exception( "Invalid operation on compared region: not the same size!" );	
    			}
    			
    			obj1 = region1.next();
    			obj2 = region2.next();
    			if( ! obj1.equals(obj2) ) {
    				Tools.scanArray(region1.getCounter(), "display");
    				Tools.scanArray(region2.getCounter(), "display");
    				throw new Exception( "Invalid operation on compared content:\n - not the same values at " + Tools.memory.toString() + "\n - region1 = " + obj1 + "\n - region2 = " + obj2  );
    			}
    		}
    		System.out.println("operation OK\n----------");
		}
		
